import React from 'react';      // Import React
import ReactDOM from 'react-dom/client';  // Import React DOM (React 18+)
import './index.css';            // Import global styles
import App from './App';          // Import the root App component

// Create a root container for rendering React
const root = ReactDOM.createRoot(document.getElementById('root'));

// Render the App component into the DOM element with id 'root'
root.render(
  <React.StrictMode>
    <App />  {/* This is the root component of your app */}
  </React.StrictMode>
);
